import React, { useState } from "react";
import { Container, Row, Col } from "react-bootstrap";
import ProductCard from "../components/ProductCard";
import CategoryFilter from "../components/CategoryFilter";

export default function Home() {
  const [selectedCategory, setSelectedCategory] = useState("All");

  const products = [
    { id: 1, name: "Red Rose Bouquet", price: 499, category: "Roses", image: "data:image/jpeg;base64," },
    { id: 2, name: "Tulip Garden Mix", price: 799, category: "Tulips", image: "data:image/jpeg;base64," },
    { id: 3, name: "Sunflower Joy", price: 599, category: "Sunflowers", image: "data:image/jpeg;base64," },
    { id: 4, name: "Luxury Orchid Basket", price: 999, category: "Luxury", image: "data:image/jpeg;base64," },
    { id: 5, name: "Mixed Love Bunch", price: 699, category: "Mixed Bouquets", image: "data:image/jpeg;base64," },
  ];

  const filteredProducts =
    selectedCategory === "All"
      ? products
      : products.filter((p) => p.category === selectedCategory);

  return (
    <Container className="py-5">
      <h2 className="text-center mb-4">Our Beautiful Collections</h2>
      <CategoryFilter
        selectedCategory={selectedCategory}
        onSelectCategory={setSelectedCategory}
      />
      <Row>
        {filteredProducts.map((product) => (
          <Col key={product.id} sm={12} md={6} lg={4} className="mb-4">
            <ProductCard product={product} />
          </Col>
        ))}
      </Row>
    </Container>
  );
}
